values for  taken from Table 2; 
sample size aggregated by condition, values from Table 1;
Regarding False news selection: We confirmed that the Breitbart (Now 400 scientific papers in 2017 say “global warming” is a myth) and Natural News (NASA confirms sea levels have been falling across the planet for two years...media silent) posts contained falsehoods by cross-checking them with an independent fact-checking database (snopes.com). The post from InfoWars (Al Gore insists global warming causes global cooling) was confirmed as false by tracing the sources and information it cited; specifically, we located the blog post shared by Mr. Gore (from The Climate Reality Project) which explained that climate change may in some cases lead to colder weather, but not a cooler climate overall.

