data correspond to experiment 1; values calculated based on data available on OSF (first, i.e. 'initial' wave);
Two-wave panel design: In the treatment conditions, participants saw “true” and “false” tags immediately before, during, or immediately after reading. In the control condition, participants rated the headlines alone, with no tags. One week later, all participants judged the same 36 headlines for accuracy, this time with no veracity information.
weird: in their text, they write about the sample size: "In two experiments (total N = 2,683)". We find an overal sample size of 3268 (1612 experiment 1, 1656 experiment 2). This matches their pre-registration

data correspond to experiment 2; values calculated based on data available on OSF (first, i.e. 'initial' wave);
Two-wave panel design: In the treatment conditions, participants saw “true” and “false” tags immediately before, during, or immediately after reading. In the control condition, participants rated the headlines alone, with no tags. One week later, all participants judged the same 36 headlines for accuracy, this time with no veracity information.
weird: in their text, they write about the sample size: "In two experiments (total N = 2,683)". We find an overal sample size of 3268 (1612 experiment 1, 1656 experiment 2). This matches their pre-registration

