data correspond to study 2, the US samples (sample 2a and 2b); values taken from supplement S15; only took the 20-Mist value for all scales;
data are technically to be excluded, because they made up headlines - BUT it was generated based on real headlines by an AI algorithm, so I decided to include it;
was not obvious to find out how they calculated their scores: their response scale was binary and they simply added up correct responses for true news (called 'r', 10 news items, thus score from 0 to 10). We divide the resulting score by 10, so that it corresponds to a 0 to 1 scale. This will make analysis later more straigthforward, as we enter this study as using a binary response scale ('1'), and all other values on that scale actually range between 0 and 1 and not between 0 and 10. We keep the 'f' score divided by 10 for the SD value. For fake news ('f') correctly identified news were counted, i.e. correclty identifying fake news as fake. To fill out our variable (fake news as accurate, in the sense that wrongly labeled as accurate) we thus calculate 1-'f'/10.;

