attention: original scale was from 1 to 6; upon request via e-mail, they explained they transposed this as follows to a scale from 0 to 1: "This is how it was done: rating=(rating-1)/5,This way, resulting values went from 1,2,3,4,5,6 to 0,.2,.4,.6,.8,1"

