data correspond to study 2; values calculated based on their data to be able to differentiate between different types of groups; values cross-checked with their appendix table;
As in study 1, respondents answered 1 question per cell (i.e. 16). However, in addition to that, respondents were randomly selected to evaluate all of three possible stories in one cell, hence evaluating 18 stories in total. We will ignore this, and just report as if they had evaluated 16. 
we averaged fake news news across the 'pro-kremelin' and the 'undermining Ukraine' groups; descriptive stats;
not explicitly clear how the fake news were displayed - 'title' only and 'no source' are coded based on best guesses from appendix;
regarding `news_pool`: "Given the face-to-face nature of the study and time constraints, we chose only 48 stories on which to concentrate in this study—with three stories in each of the 16 cells, which maintained coverage on all three disinformation strategies, true stories, and all four topics. Additionally, respondents were randomly selected to choose all three stories in one cell, evaluating 18 stories in total." Since we group by `news_family`, we divide this newspool by the amount of news_family groups (4).

data correspond to study 2b, fluent condition; values from own calculations based on their data;
note that we code the fluent condition as a control condition since that's what all other control conditions are; we code the disfluent condition as negative treatment, as the authors hypothesized it to reduce accuracy ratings;
we coded newsID as "NA" since the headlines were the same as in study 2a, but a combination of newsID = 3 and 4. We want to avoid to count these twice when checking unique headlines

data correspond to study 3, no prior condition; values from own calculations based on their data;
