data correspond to control condition (no warning); values taken from paper (results section, first paragraph);
the authors coded correct vs. non correct responses. While for true news, hits correspond to accurate vs. not accurate, for fake news, we code accuracy score as 1 - hits (or misses). SD's remain the same in both cases.;
lack of transparency about the sample, all we know from one section is that " Since many participants were recruited in Germany, a summary in German was displayed alongside the post.", which is why we coded Germany.

