All first wave results can be considered control: "After completing the first wave questionnaire, respondents were randomly assigned, via simple randomization, to one of two conditions. After the first wave of the survey and before the second, the treatment group (n = 575) received the main experimental stimuli comprised of a multidimensional intervention seeking to reduce rumor acceptance."; 
For the second wave, we distinguish between control and treatment group; 
In order to be consistent in the sample id's, we nevertheless split the the first wave results into two samples, one for the control and one for the treatment group; 
For the second wave, they repeated some headlines of the first wave and added other new ones - we only consider the new ones; 
