note that we'll code simply "political" as headline subject for those participants who are neither democrat nor republican, as we did for other studies;
for study 2, the manuscript states that participants saw 20 items (out of a pool of 60 items, in study 2). That seems to be the case for the vast majority of participants (N = 2310), but there are 191 participants who have valid (i.e. non-NA) responses for all 60 news items. We will treat participants who gave 60 answers as a separate sample.

