data correspond to study 2 (2020), participants who rated 16 items, politically concordant items; 
from correspondance with author, we know that while most participants evaluated 16 items, some also evaluated 32; 
those with 16 always evaluated the same 16 (minor exceptions in study 2 that we will gloss over); 
we do not know how many neutral/concordant/discordant items each participant saw - to approximate, we calculate the share of neutral and political slant news in the news pool and multiply that share with the number that participants rated; for example: the pool contained 21 neutral news out of 50 total (21/50 = 0.42) so we assume participants who rated 16 items rated (16*0.42=) 6.72 neutral news; and (16*((1-0.42)/2)) = 4.64 concordant/discordant items, respectively

